import React, { useState } from "react";
import { NavLink } from "react-router-dom";

const Login = () => {
  const [inputField, setInputField] = useState({
    username: "",
    password: "",
  });

  const handleChange = (e) => {
    setInputField({ ...inputField, [e.target.name]: e.target.value });
  };

  // No need for the handlelogin function in this example

  return (
    <>
      <section className="login login_z">
        <div className="login_box">
          <div className="left">
            <div className="top_link"></div>
            <div className="contact">
              <form action="">
                <h3>LOG IN PAGE</h3>
                <input
                  type="text"
                  name="username"
                  value={inputField.username}
                  onChange={handleChange}
                  placeholder="USERNAME"
                />
                <input
                  type="password"
                  name="password"
                  value={inputField.password}
                  onChange={handleChange}
                  placeholder="PASSWORD"
                />

                {/* You can add navigation links here */}
                <NavLink to="/Home" className="submit">
                  LET'S GO
                </NavLink>

                {/* Add other navigation links */}
                <NavLink to="/AnotherPage" className="nav-link">
                  Another Page
                </NavLink>
              </form>
            </div>
          </div>
          <div className="right">
